package org.easy.easysocket;

import java.io.Serializable;

public class Person implements Serializable {
	private String name;
	private int age;
	private String s;

	public Person() {
	}

	public Person(String name, int age) {
		this.name = name + "";
		this.age = age;
		this.s = this.name;
	}

	@Override
	public String toString() {
		return "Person{" +
				"name='" + name + '\'' +
				", age=" + age +
				", s='" + s + '\'' +
				'}';
	}
}
